import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Slider from './componentes/Slider';
import Footer from './componentes/Footer';


ReactDOM.render(
  <React.StrictMode>

    <Slider />
    <App />
    <Footer />
  </React.StrictMode>,
  document.getElementById('root')
);
